import React from 'react';
import { Link } from "react-router-dom";
import './Navbar.css';


function Navbar() {
  

  return (
    <>
      {/* <h1>This is the NavBar page</h1> */}
      <div className="navbar active">
      <ul >
      {/* <li><img src={'./assest/logo.svg'} alt="" srcset="" /></li> */}
      {/* <img src={'./assest/Favicon.png'} alt="" srcset="" /> */}
         <div className="logo"> <li> New Coding Era</li></div>
         <div className="right">
       
          <li> <Link to="home">Home page</Link></li>
          <li> <Link to="blog"> Blog page</Link></li>
          <li> <Link to="support"> Support Us</Link></li>
          <li> <Link to="contact"> Contact Us</Link></li>
       
          </div> 
          <button >  <input type="checkbox" id="checkbox_toggle" /> <i id='1' class="fa-solid fa-bars " ></i></button>
      </ul>
      </div>
    </>
  );
}

export default Navbar;
